import {
  AlertCircle,
  Bold,
  Droplet,
  Gift,
  HelpCircle,
  Home,
  Image,
  Link,
  MapPin,
  MessageCircle,
  Navigation,
  PieChart,
  Sidebar,
  Terminal,
  Type,
  Underline,
  User
} from 'react-feather';

export default [
  {
    path: '/',
    name: 'Home',
    icon: <Home strokeWidth={1} size={16} />
  },
  {
    name: 'Apps',
    icon: <MessageCircle strokeWidth={1} size={16} />,
    children: [
      {
        path: '/apps/calendar',
        name: 'Calendar'
      },
      {
        path: '/apps/messages',
        name: 'Messages'
      },
      {
        path: '/apps/social',
        name: 'Social'
      },
      {
        path: '/apps/chat',
        name: 'Chat'
      }
    ]
  },
  {
    path: '/widgets',
    name: 'Widgets',
    icon: <Droplet strokeWidth={1} size={16} />,
    badge: {
      value: '5'
    }
  },
  {
    path: '/taskboard',
    name: 'Taskboard',
    icon: <Sidebar strokeWidth={1} size={16} />,
    badge: {
      value: 'New'
    }
  },
  {
    name: 'Charts',
    icon: <PieChart strokeWidth={1} size={16} />,
    children: [
      {
        path: '/charts/plots',
        name: 'Plots'
      },
      {
        path: '/charts/axes',
        name: 'Axes'
      },
      {
        path: '/charts/legends',
        name: 'Legends'
      },
      {
        path: '/charts/sunburst',
        name: 'Sunburst'
      },
      {
        path: '/charts/radial',
