      },
      {
        path: '/charts/treemaps',
        name: 'Treemaps'
      },
      {
        path: '/charts/radar',
        name: 'Radar charts'
      },
      {
        path: '/charts/misc',
        name: 'Misc'
      }
    ]
  },
  {
    name: 'Media',
    icon: <Image strokeWidth={1} size={16} />,
    children: [
      {
        path: '/media/grid',
        name: 'Grid'
      },
      {
        path: '/media/tile',
        name: 'Tile'
      }
    ]
  },
  {
    name: 'Maps',
    icon: <MapPin strokeWidth={1} size={16} />,
    children: [
      {
        path: '/maps/markers',
        name: 'Markers'
      },
      {
        path: '/maps/geojson',
        name: 'Geo JSON'
      }
    ]
  },
  {
    name: 'Extras',
    icon: <Gift strokeWidth={1} size={16} />,
    children: [
      {
        path: '/extras/invoice',
        name: 'Invoice'
      },
      {
        path: '/extras/timeline',
        name: 'Timeline'
      },
      {
        path: '/extras/blank',
        name: 'Blank'
      },
      {
        path: '/extras/pricing',
        name: 'Pricing'
      }
    ]
  },
  {
    name: 'Authentication',
    icon: <User strokeWidth={1} size={16} />,
    children: [
      {
        path: '/signin',
        name: 'Signin'
      },
      {
        path: '/signup',
        name: 'Signup'
      },
      {
        path: '/forgot',
        name: 'Forgot'
      },
      {
        path: '/lockscreen',
        name: 'Lockscreen'
      }
    ]
  },
  {
    name: 'Error',
    icon: <AlertCircle strokeWidth={1} size={16} />,
    children: [
      {
        path: '/thisroutedoesntwork',
        name: '404'
      },
      {
        path: '/500',
        name: 'Error'
      }
    ]
  },
  {
    name: 'General elements',
    icon: <Bold strokeWidth={1} size={16} />,
    children: [
      {
        path: '/general/button',
        name: 'Button'
      },
      {
        path: '/general/icon',
        name: 'Icon'
      }
    ]
  },
  {
    name: 'Navigation',
    icon: <Navigation strokeWidth={1} size={16} />,
    children: [
