        name: 'Tooltip'
      },
      {
        path: '/data-display/timeline',
        name: 'Timeline'
      },
      {
        path: '/data-display/tag',
        name: 'Tag'
      },
      {
        path: '/data-display/tabs',
        name: 'Tabs'
      },
      {
        path: '/data-display/table',
        name: 'Table'
      }
    ]
  },
  {
    name: 'Feedback',
    icon: <Terminal strokeWidth={1} size={16} />,
    children: [
      {
        path: '/feedback/alert',
        name: 'Alert'
      },
      {
        path: '/feedback/drawer',
        name: 'Drawer'
