      {
        path: '/feedback/modal',
        name: 'Modal'
      },
      {
        path: '/feedback/message',
        name: 'Message'
      },
      {
        path: '/feedback/notification',
        name: 'Notification'
      },
      {
        path: '/feedback/progress',
