  {
    path: 'https://one-readme.fusepx.com',
    name: 'Documentation',
    icon: <HelpCircle strokeWidth={1} size={16} />
  },
  {
    path: 'https://nyasha.me',
    name: 'Browse more templates',
    icon: <Link strokeWidth={1} size={16} />
  }
];
